    title: "Car Insuarance",
    amount: 293.67,
    date: new Date(2021, 2, 28),
  },
  {
    id: "e2",
    title: "EMI",
    amount: 203.67,
    date: new Date(2021, 2, 1),
  },
  {
    id: "e3",
    title: "Shopping",
    amount: 103.67,
    date: new Date(2021, 4, 3),
  },
];

function App() {

  const AddDataHandler = expense => {
